from django.views.generic.base import (
    ContextMixin, TemplateResponseMixin, View
)

from repository import Repository
from utils.auth import login


class Home(TemplateResponseMixin, ContextMixin, View):

    template_name = "form.html"

    def get(self, request, *args, **kwargs):
        context = self.get_context_data(**kwargs)

        username_or_email = request.GET.get("user", '')
        company = request.GET.get("company", '')

        if username_or_email and company:

            # lang = request.GET.get("lang", '')
            # country = request.GET.get("country", '')

            # if not lang:
            #     raise Http404(_("User language not found"))

            # if not country:
            #     raise Http404(_("Company country not found"))

            _kwargs = {
                "company": company,
            }

            user = login.perform_ma_login(request, username_or_email, _kwargs)
            if user is not None:
                translation.activate(user.profile.language)
                request.session['prueba'] = user.get_email()
                return self.render_to_response(context)
            else:
                raise Http404(_("User not authenticate"))
        else:

            raise Http404(_("User not found"))

